package LabAssForLoop;

public class Ass6 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub


		int one = "a".length();                     // 1
        int fifty = 'z' - 'F' - "aa".length();     // 122 - 70 - 2 = 50

        for (int i = one; i <= fifty; i += one) {
            System.out.println(i);
        }

		
		
	}
}
